import { useState } from 'react';
import './Counter.css';
import ShowCounter from './ShowCounter';

let  Count= 0;

function Counter() {
    
    const [count, setCount] = useState(0)
    const incFn = () => {
        setCount(count + 1)
    }
    const decFn = () => {
        setCount(count - 1)
    }
    return (
        <div>
            
             <ShowCounter />
             
            <div>
                <button onClick={decFn}>DEC</button>
                <button onClick={incFn}>INC</button>

            </div>
        </div>

    );
    
}






export default Counter;
